(function ($) {
  'use strict';

  var $hamburger;
  var $mobileMenu;
  var $arrowToggles;
  var $backButtons;
  var $subMenus;
  var breakpoint = window.matchMedia('(min-width: 1200px)');

  var initMobileMenu = function () {
    $hamburger = $(this);
    $mobileMenu = $('.cc--menu-mobile');
    $arrowToggles = $mobileMenu.find('.arrow-toggle');
    $subMenus = $mobileMenu.find('.submenu-wrapper');
    $backButtons = $mobileMenu.find('.button-back');

    // click on hamburger
    $hamburger.on('click', function (e) {
      e.preventDefault();
      toggleMobileMenu(this);
    });

    $arrowToggles.on('click', function (e) {
      e.preventDefault();
      var $subMenu = $(this).parents('.menu-item').find('.submenu-wrapper');
      $subMenu.attr('aria-hidden', 'false');
      $subMenu.show();
      $subMenu.removeClass('is-hidden').addClass('is-visible');
      $mobileMenu.addClass('is-hidden');
    });

    $backButtons.on('click', function (e) {
      e.preventDefault();
      var $this = $(this);
      $this.parents('.submenu-wrapper').attr('aria-hidden', 'true');
      $this.parents('.submenu-wrapper').addClass('is-hidden');
      $this.parents('.submenu-wrapper').removeClass('is-visible');
      $mobileMenu.removeClass('is-hidden');
    });

    checkBreakpoint();
    breakpoint.addListener(checkBreakpoint);
  };

  var checkBreakpoint = function () {
    if (breakpoint.matches) {
      $hamburger.removeClass('is-active');
      $mobileMenu.removeAttr('style');
      $('body').removeClass('mobile-menu-is-active');
      hideAllSubmenus();
    }
  };

  var toggleMobileMenu = function (el) {
    $('body').toggleClass('mobile-menu-is-active');
    $(el).toggleClass('is-active');
    $mobileMenu.fadeToggle(function () {
      if (!$('body').hasClass('mobile-menu-is-active')) {
        hideAllSubmenus();
      }
    });
  };

  var hideAllSubmenus = function () {
    $subMenus.removeClass('is-visible');
    $mobileMenu.removeClass('is-hidden');
  };

  window.DP.behaviors.mobileMenu = {
    attach: function (context) {
      $(context).find('.hamburger').once('mobileMenu').each(function () {
        initMobileMenu.apply(this);
      });
    }
  };

}(jQuery));
