(function ($, Drupal) {
  Drupal.behaviors.alertBanner = {
    attach: function attach(context) {
      $('body', context).once('notification_banner').each(function () {

        $.ajax({
          url: Drupal.url('gateway/api/notification-banner'),
          dataType: 'json',
          success: function success(results) {
            if (results.length <= 0) {
              return;
            }

            var key = 'Drupal.notification_banner.updated';

            if (results.length > 0) {
              for (var i = 0; i < results.length; i++) {
                var banner = results[i];
                var changed = banner['changed'];
                var banner_key = key + '.' + banner['nid']
                if (changed !== localStorage.getItem(banner_key)) {
                  var bannerHtml = Drupal.theme('showNotificationBanner', banner);

                  if (banner['level'] === 'extreme_emergency') {
                    $('.cc--notification-banner', context).remove();
                    $('#block-umass-base-content', context).html(bannerHtml);
                    $('body').removeClass('transparent-header');
                    break;
                  }

                  if ($('.cc--notification-banner', context).length > 0) {
                    $('.cc--notification-banner', context).last().after(bannerHtml);
                  }
                  else {
                    $('body').prepend(bannerHtml);
                  }
                  var banner_html = $('.cc--notification-banner[data-nid="' + banner['nid'] + '"]', context);
                  $('button.close-notification', banner_html).on('click', function (e) {
                    localStorage.setItem(banner_key, changed);
                    $(this).closest('.cc--notification-banner').remove();
                    $(document).trigger('bannerUpdate');
                  });
                }
              }

              $(document).trigger('bannerUpdate');
            }
          }
        });
      });
    }
  };

  Drupal.umassCore = Drupal.umassCore || {};

  Drupal.umassCore.getArguments = function (result) {
    let res = result;
    let args = [];
    args['level'] = res.level;
    args['title'] = res.title;
    args['update_text'] = res.update_text;
    args['description'] = res.description;
    args['link_title'] = res.link_title;
    args['link_url'] = res.link_url;
    args['nid'] = res.nid;

    return args;
  };

  Drupal.theme.showNotificationBanner = function (results) {
    let args = Drupal.umassCore.getArguments(results);
    let extreme = false;
    let type =  args['level'];
    if (type === 'extreme_emergency') {
      type = 'emergency';
      extreme = true;
    }

    let html = '<div class="cc--component-container cc--notification-banner ' + type + '" data-nid="' + args['nid'] + '">' +
      '<div class="c--component-container c--notification-banner">' +
        '<div class="notification-banner-inner">' +
          '<div class="left">' +
            '<svg class="icon-alert" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" x="0px"\n' +
              'y="0px" viewBox="0 0 50 50" width="50" height="50" enable-background="new 0 0 50 50" xml:space="preserve">\n' +
              '  <title>Notification Icon</title>\n' +
              '  <path fill-rule="evenodd" clip-rule="evenodd" fill="#FFFFFF" d="M29.4,10H21l1,18.5h6.4L29.4,10z\n' +
              '    M25.2,31.6c-1.3,0-2.4,0.3-3.1,1c-0.7,0.7-1.1,1.6-1.1,2.8c0,1.2,0.4,2.1,1.1,2.7c0.7,0.7,1.7,1,3,1c1.3,0,2.3-0.3,3-1\n' +
              '  c0.7-0.7,1.1-1.6,1.1-2.7c0-1.2-0.3-2.1-1-2.8C27.5,31.9,26.5,31.6,25.2,31.6z M25,0c13.8,0,25,11.2,25,25S38.8,50,25,50\n' +
              '  S0,38.8,0,25S11.2,0,25,0z"/>\n' +
              '</svg>\n' +
            '<span class="alert-title">' + args['title'] + '</span>' +
          '</div>\n' +
          '<div class="right">' +
            '<div class="f--field f--wysiwyg">' + args['description'] + '</div>' +
            '<div class="f--field f--wysiwyg date-updated">' + args['update_text'] + '</div>' +
            '<div class="f--field f--link">' +
              '<a class="link" href="' + args['link_url'] + '">' + args['link_title'] + '</a>\n' +
            '</div>';


    html += '    </div>\n';
    if (!extreme) {
      html += '    <button class="close-notification">\n' +
        '      <svg version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" x="0px" y="0px"\n' +
        '   viewBox="0 0 17.8 17.8" width="18" height="18" enable-background="new 0 0 17.8 17.8" xml:space="preserve">\n' +
        '        <title>Close Notification</title>\n' +
        '        <polygon fill-rule="evenodd" clip-rule="evenodd" fill="#FFFFFF" points="16.38,0 17.8,1.41 10.31,8.9\n' +
        '\t17.8,16.38 16.38,17.8 8.9,10.31 1.41,17.8 0,16.38 7.49,8.9 0,1.41 1.41,0 8.9,7.49 "/>';
    }
    html +=  '  </div>' + '    </div>\n' + '    </div>\n';
    return html;
  };
})(jQuery, Drupal);
;
